export function get(url = '')
{
    var options = {
        url : url,
        method: 'GET',
        cache: 'no-cache',
        withCredentials: 'omit',
        headers: {
            'Content-Type':  'application/json'
          },
        redirect: 'follow'
      };
      return axios(url, requestOptions);
}

